	paper: {
		padding: theme.spacing(5),
		color: theme.palette.text.secondary,
		alignItems: 'center'
	}
})); */

export default function sellers() {
  /* const [encabezado, setencabezado] = useState([
		{
			country: '',
			hts: '',
			hidden: false,
			destination: ''
		}
	]); */

  const [oculto, setoculto] = useState({
    hiddenboton: true,
    //hiddenperfilform: false,
    hiddentable: true,
    //hiddendetails: false,
  });

  // Creo el estado del detalles de la cotizacion que se eligira , para mostrarlo

  return (
    <div>
      {" "}
      <Grid container spacing={gridSpacing}>
        <Grid item lg={12} md={12} sm={12} xs={12}>
          <SellerListTools oculto={oculto} setoculto={setoculto} />
        </Grid>
        <Grid item lg={12} md={12} sm={12} xs={12}>
          <SellerListTable />
        </Grid>
        <Grid item xs={6}>
          {/* <SkuStoreForm /> */}
        </Grid>
        <Grid item xs={6}>
          <Paper>
            {/* <SkuStoreFiles skus="legales" idcliente="abcdef" /> */}
          </Paper>{" "}
        </Grid>
        <Grid item xs={6}>
          {/* <Lister idcliente="abcdef" codigo="legales" /> */}
        </Grid>
      </Grid>
    </div>
  );
}
